8: **ABSTRACT:** **Introduction:**In the modern era, the use of probiotics has gained tremendous importance, which has been shown to improve the oral environment. This study aimed to evaluate the antibacterial efficacy of various probiotics and chlorhexidine.

9: **Materials and Methods:**The effect of probiotics on Streptococcus mutans (S. mutans) and Lactobacillus casei (L. casei) were investigated using dual culture technique. The antibacterial efficacy of various probiotics and chlorhexidine were evaluated against biofilm formation by S. mutans using biofilm model.

10: **Results:**Probiotic strain L. casei significantly inhibited the growth of S. mutans and L. casei at 1:1, 1:2, and 1:3 ratios. Chlorhexidine and L. casei had significant antibacterial efficacy against S. mutans biofilm in biofilm model. L. casei and chlorhexidine had similar antibacterial efficacy against S. mutans biofilm at 1:1 ratio.

11: **Conclusion:**Lactobacillus casei is comparable to chlorhexidine in terms of antibacterial efficacy against S. mutans and can be a potential probiotic for preventing dental caries.

12: 

13: Oral microorganisms colonize and grow in a complex ecosystem forming a biofilm, which is referred to as dental plaque. The oral biofilm is the primary etiological factor for a majority of dental diseases such as dental caries, periodontal diseases, and peri-implantitis. Dental caries and periodontal diseases are chronic infections that are induced by specific oral microorganisms including *Streptococcus mutans* (*S. mutans*) and *Lactobacillus casei* (*L. casei*), respectively. *S. mutans* is a major cariogenic bacterium in dental caries and *L. casei* is a key bacterium in the progression of caries and root caries.[[1]]

14: Chlorhexidine is widely used as the gold standard chemical agent for the prevention and treatment of dental caries. Its antibacterial efficacy is due to the ability to bind to oral tissues and to inhibit the growth of oral microorganisms including *S. mutans* and *L. casei*. Although it is highly effective against a wide range of microorganisms, it is associated with some side effects including staining of teeth, alteration in taste, and increase in dental calculus formation.[[2]] The limitation of chlorhexidine has led to the search for alternative therapeutic agents to prevent and control dental caries. Thus, the use of probiotics has gained importance in recent years.[[3]]

15: Probiotics are live microorganisms that are beneficial to the host, which confer health benefits when consumed in adequate amounts. The oral administration of probiotics has been shown to improve the oral environment by inhibiting the growth of *S. mutans* and *L. casei*. Probiotics have also been reported to inhibit the development of dental caries, gingivitis, periodontitis, and to reduce halitosis.[[4]] Several probiotic strains are used in probiotic products including *Lactobacillus rhamnosus, Lactobacillus salivarius, Lactobacillus reuteri, Lactobacillus acidophilus, Streptococcus salivarius, Streptococcus thermophilus*, and *Bifidobacterium animalis*. These probiotics have been demonstrated to have antibacterial efficacy against *S. mutans* and *L. casei* and are used as safe and effective alternatives to chemical agents such as chlorhexidine in the prevention and treatment of dental caries.[[5] [6]]

16: *Lactobacillus casei* is a facultative anaerobe, Gram-positive, rod-shaped, non-spore-forming, and non-motile bacterium. *L. casei* is one of the widely used probiotic strains. It is commonly found in the gastrointestinal tract and vaginal microbiome. It has been used for the prevention and treatment of bacterial vaginosis, irritable bowel syndrome, antibiotic-associated diarrhea, and for the treatment of certain types of cancers including breast, lung, and colon cancer.[[7]] *L. casei* also possesses antibacterial efficacy against oral microorganisms and is used in the prevention and treatment of dental caries. However, its antibacterial efficacy against *S. mutans* and *L. casei* is not well documented. Thus, the aim of the present study was to evaluate the antibacterial efficacy of various probiotics and chlorhexidine against *S. mutans* and *L. casei* using dual culture technique. The antibacterial efficacy of various probiotics and chlorhexidine against *S. mutans* biofilm was also evaluated in biofilm model.

17: 

18: The study was conducted in the Department of Microbiology, Kamineni Institute of Dental Sciences and Research, Kakinada, Andhra Pradesh, India, from October 2020 to March 2021. Ethical clearance was obtained from the Institutional Ethics Committee (IEC No: KIDS/IEC/2020/02-10/06). The study comprised two phases.

