20: *S. mutans* ATCC 25175 (American Type Culture Collection) and *L. casei* ATCC 393 was procured from IMTECH (Institute of Microbial Technology), Chandigarh, India. The probiotics *L. casei* 01, *L. rhamnosus* 02, *L. acidophilus* 03, *L. salivarius* 04, *L. reuteri* 05, *Bifidobacterium* 06, *Streptococcus salivarius* 07, and *Streptococcus thermophilus* 08 were procured from Microbiologics (St. Cloud, MN, USA). Chlorhexidine 0.2% (Antiseptic, Denture Cleanser) was obtained from Zandu Pharmaceuticals Limited, Mumbai, India.

