7: Objectives. To investigate the correlation between plasma homocysteine (Hcy) and cystatin C (Cys C) with diabetic nephropathy (DN) in patients with type 2 diabetes mellitus (T2DM). Methods. The subjects were 116 T2DM patients divided into the control group and DN group and 61 healthy volunteers. The plasma Hcy and Cys C were detected by ELISA. Results. The levels of plasma Hcy and Cys C in DN group were significantly higher than those in control group and healthy control group (P < 0.01). The levels of plasma Hcy and Cys C in DN group with abnormal urinary albumin excretion (UAER) were significantly higher than those in DN group with normal UAER (P < 0.01). The levels of plasma Hcy and Cys C in DN group with abnormal UAER were significantly higher than those in healthy control group (P < 0.01). The levels of plasma Hcy and Cys C in DN group with normal UAER were significantly higher than those in healthy control group (P < 0.01). The levels of plasma Hcy were significantly correlated with those of Cys C in DN group (r = 0.393, P < 0.01). The levels of plasma Cys C were positively correlated with 24 h urinary albumin excretion (UAER) in DN group (r = 0.354, P < 0.01). The levels of plasma Hcy were positively correlated with UAER in DN group (r = 0.296, P < 0.01). Conclusion. Plasma Hcy and Cys C levels are increased in T2DM patients with DN, especially in patients with abnormal UAER. Both plasma Hcy and Cys C levels are correlated with the severity of DN, and plasma Hcy may play a role in the pathogenesis of DN through promoting renal injury.

8: 

9: Diabetic nephropathy (DN) is one of the most common chronic complications in patients with type 2 diabetes mellitus (T2DM). The pathological changes of DN are glomerular basement membrane thickening, glomerular capillary cell proliferation, and mesangial matrix accumulation [[1], [2]]. The clinical manifestations of DN include renal insufficiency, hypertension, and dyslipidemia, and it eventually develops to chronic kidney disease and end-stage renal disease. DN is also an important cause of death in patients with T2DM [[3]]. Currently, the diagnosis of DN is mainly based on clinical manifestations and urine albumin excretion (UAER) [[4], [5]]. However, these indexes cannot directly reflect the pathological changes in DN. It is very important to seek effective biomarkers that can early detect the occurrence and development of DN, which could guide clinical diagnosis and treatment and improve the prognosis of patients.

10: Homocysteine (Hcy) is an intermediate product in the metabolism of methionine, which can be synthesized from methionine by cystathionine *β*-synthase [[6]]. Hcy can be degraded into cysteine and cystathionine by cystathionine *β*-synthase [[7]]. Hcy is also involved in the synthesis of cysteine by cysteine synthase [[8]]. In addition, Hcy can be converted to methionine by methionine synthase through the remethylation pathway. The plasma Hcy level is determined by the rate of Hcy synthesis and excretion. The level of plasma Hcy in normal human body is very low, and an increase in plasma Hcy level is called hyperhomocysteinemia (HHcy) [[9]]. HHcy is a common complication in patients with diabetes mellitus (DM). Many studies have found that HHcy is associated with microvascular complications, such as diabetic retinopathy (DR), diabetic peripheral neuropathy (DPN), and DN [[10]– [12]]. There is currently no direct evidence for the pathogenesis of HHcy in DN, but it is generally believed that the occurrence of DN is closely related to the vascular endothelial dysfunction induced by HHcy. Therefore, plasma Hcy may be an effective biomarker of DN.

11: Cystatin C (Cys C) is a member of the cystatin superfamily, which consists of 11 kinds of cysteine protease inhibitors [[13]]. Cys C is produced and secreted by nucleated cells and is distributed in plasma and extracellular fluid [[14]]. Cys C is a glomerular filtration product that is reabsorbed and metabolized by proximal tubular epithelial cells, and its concentration in plasma is determined by the balance between glomerular filtration and reabsorption. Studies have shown that the level of plasma Cys C is closely related to renal function and can be used to evaluate renal function [[15], [16]]. A recent study has found that the level of plasma Cys C is higher in T2DM patients than in healthy individuals [[17]]. In addition, a previous study has found that plasma Cys C is an effective biomarker of DN [[18]]. It is currently unclear about the correlation between plasma Cys C and DN in patients with T2DM.

12: At present, the pathogenesis of DN is still not fully understood. The aim of this study was to investigate the correlation between plasma Hcy and Cys C with DN in T2DM patients. In this study, we explored the relationship between plasma Hcy and Cys C with the occurrence and development of DN, which may provide new evidence for the early diagnosis and treatment of DN.

